import React, { Component } from "react"

export default class Dog extends Component {
    constructor() {
        super()
        this.state = {
            allPups: ""
        }
    }


    fetchPups() {
        fetch("http://localhost:3000/pups")
            .then(resp => resp.json())
            .then(pups => {
                this.setState({ allPups: pups })
                console.log(this.allPups)
            })
    }

    render() {
        this.fetchPups()
        return (
            <span>{this.state.allPups}</span>
        )
    }
}
